import React from 'react';
import './Insights.css';

const insightsData = [
  {
    title: 'Teachers',
    count: 4
  },
  {
    title: 'Students',
    count: 20
  },
  {
    title: 'Gender of students',
    count: 'Girls: 10, Boys: 10'
  }
];

function Insights() {
  return (
    <div className="insights">
      {insightsData.map((item, index) => (
        <div className="insight-item" key={index}>
          <h3>{item.title}</h3>
          <h1>{item.count}</h1>
        </div>
      ))}
    </div>
  );
}

export default Insights;
